class Solution {
    fun maximumTripletValue(nums: IntArray): Long {
        var maxProduct = 0L
        var maxI = Int.MIN_VALUE
        var maxK = IntArray(nums.size) { 0 }

        // Scan from right to left to find the maximum value of nums[k]
        for (k in nums.size - 1 downTo 2) {
            maxK[k] = maxOf(maxK.getOrElse(k + 1) { 0 }, nums[k])
        }

        // Keep track of the maximum value of nums[i] from the left
        for (i in 0 until nums.size - 2) {
            maxI = maxOf(maxI, nums[i])
            for (j in i + 1 until nums.size - 1) {
                val potentialProduct = (maxI - nums[j]).toLong() * maxK[j + 1]
                maxProduct = maxOf(maxProduct, potentialProduct)
            }
        }

        return maxProduct
    }
}
